		/// <summary>
		/// Raises the <see cref="ColumnChanged" /> event.
		/// </summary>
		/// <param name="column">The <see cref="MetaObjectColumn"/> which has raised the event.</param>
		public virtual void OnColumnChanged(MetaObjectColumn column)
		{
